INSERT INTO `table_service` (`service_id`, `service_title`, `service_slug`, `service_category`, `service_price`, `service_price_info`, `service_price_server_1`, `service_info_server_1`, `service_price_server_2`, `service_info_server_2`, `service_price_server_3`, `service_info_server_3`, `service_price_server_4`, `service_info_server_4`, `service_min_amount`, `service_max_amount`, `service_info`, `service_noted`, `service_status`, `service_time`) VALUES
(10, 'Tăng like bài viết speed  Facebook', 'buff-like-post-facebook', 'facebook', '48', '(Like Người Việt Thật, Max 50K)', '22', '(Like Việt, Rẻ Tốt Nhất, Max 50K)', '22', '(Like Việt, Lên Nhanh, Có Tụt Like)', '11', '(Like Clone Việt, Lên Nhanh, , Max 3K)', '0', '', '50', '50000', '<p>- Mua bằng ID b&agrave;i viết đ&atilde; mở chế độ theo d&otilde;i c&ocirc;ng khai (phải c&oacute; n&uacute;t like).</p>\n<p>- Ch&uacute;ng t&ocirc;i kh&ocirc;ng ho&agrave;n tiền cho đơn đ&atilde; thanh to&aacute;n.</p>', '<p>- Ngi&ecirc;m cấm Buff c&aacute;c ID Seeding c&oacute; nội dung vi phạm ph&aacute;p luật, ch&iacute;nh trị, đồi trụy... Nếu cố t&igrave;nh buff bạn sẽ bị trừ hết tiền v&agrave; banned khỏi hệ thống vĩnh viễn, v&agrave; phải chịu ho&agrave;n to&agrave;n tr&aacute;ch nhiệm trước ph&aacute;p luật.</p>\n<p>- Kh&ocirc;ng c&agrave;i nhiều đơn c&ugrave;ng 1 l&uacute;c, <strong>đơn cũ l&ecirc;n xong th&igrave; mới l&ecirc;n tiếp đơn mới</strong>.</p>\n<p>- Kh&ocirc;ng mua đơn nhiều site 1 l&uacute;c, tụt hay thiếu kh&ocirc;ng hỗ trợ.</p>\n<p>- Mỗi ID c&oacute; thể <strong>tăng tối đa 10 lần tr&ecirc;n hệ thống để tr&aacute;nh Spam</strong>, cần mua th&ecirc;m vui l&ograve;ng li&ecirc;n hệ với admin để được giải quyết.</p>\n<p>- Nhập id lỗi hoặc trong thời gian chạy die id th&igrave; h<strong>ệ thống kh&ocirc;ng ho&agrave;n lại tiền</strong>.</p>', '1', '1624489396'),
